import React from "react";
import ReactDOM from "react-dom";
import OpticMap from "./OpticMap";
import "./index.css";

class App extends React.Component {
  render() {
    return (
      <div>
        <OpticMap />
      </div>
    );
  }
}

ReactDOM.render(<App />, document.getElementById("root"));
